import React from "react";
import Header from "./Header";
import Home from "./Home";
import Footer from "./Footer";
import "./App.css";
import {BrowserRouter, Router, Route} from 'react-router-dom';
import Board from "./Board";

function App() {
  return (
    <BrowserRouter>
        <div className="App">
              <Header />
               <Router>
                <Route path="/">
                  <Home />  
                </Route>

                <Route path="/board">
                  <Board/>  
                </Route>
              </Router> 
              <Footer />

        </div>
    </BrowserRouter>    
  );
}

export default App;
